import { React, useState, useEffect } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

export function Home() {
  const [meals, setMeals] = useState([]);
  const fetctData = async () => {
    const response = await (await fetch("http://localhost:5000/meal")).json();

    console.log(response);
    setMeals(response);
  };

  useEffect(() => {
    fetctData();
  }, []);

  return (
    <Router>
      <div>
        <h1>Meal App</h1>
      </div>
      <Switch>
        <Route>
          <Meal param={[1, 2, 3]} />
        </Route>
      </Switch>
    </Router>
  );
}

function Meal({ param }) {
  return (
    <div>
      {param.map((meal) => (
        <div key={meal.id}>
          <h2>{meal.title}</h2>
          <h2>{meal.title}</h2>
          <h3>{meal.created_date}</h3>
        </div>
      ))}
    </div>
  );
}
